import { call, put, takeLatest,takeEvery } from 'redux-saga/effects';
import{getPostData} from'../Postapi/Postapi';
import {Flogin} from'../Action/LoginuserAction'

function* getListPostSaga(action) {
    try {
    const data = yield call(getPostData,action.payload.token);
        yield put((data: data));
    } catch (error) {
        console.log(error);
    }
    }

    function* postsSaga() {
    yield takeEvery('SETLOGOUT', getListPostSaga);
    }

    export default postsSaga;
